@Override
public void renameFile(String source, String dest) throws IOException {
  unCache(source);
  try {
    cache.deleteFile(dest);
  } catch (FileNotFoundException fnfe) {
    // OK -- it may not exist
  }
  in.renameFile(source, dest);
}

